import React from "react";
import Card from "./Card";

const CardList = ({ cards }) => {
  return (
    <div className="card-list">
      
      {cards.map((card, index) => (
        
        <Card key={index} {...card} />
      ))}
    </div>
  );
};

export default CardList;
